== Etymology ==
The name Oswin ([[Old English]]: [[Óswine (disambiguation)|Óswine]]) contains the elements ''os'' "god"  and ''wine'' "friend".<ref>{{webcite|website=Behind the Name|articlename=Oswin|articleurl=http://www.behindthename.com/name/oswin}}</ref>

